CREATE TRIGGER [dbo].[tgInsertOrder] ON [dbo].[Order_Detail_T] 
FOR INSERT
AS
	DECLARE @OrderNo VARCHAR(100)
	DECLARE @OId BIGINT
	SELECT  @OId = i.O_Id FROM inserted i
	
	SET @OrderNo= 'T0000000000'
	SET @OrderNo = CONCAT(SUBSTRING(@OrderNo,0,11-LEN(@OId)),@OId)
	UPDATE Order_Detail_T SET O_Order_Id = @OrderNo WHERE O_Id = @OId


